import React from 'react';

class OtherWeatherData extends React.Component {
  render() {
    if(this.props.data.main) {
      let Sunrise = new Date(this.props.data.sys.sunrise*1000);
      let Sunset = new Date(this.props.data.sys.sunset*1000);
      return(
        <div className="otherWeatherData">
          <div className="windSpeed">
            <h1>{this.props.data.wind.speed} m/s</h1>
            <h2>Wind</h2>
          </div>
          <div className="weatherInfoContainer">
            <div className="left_block">
              <h1>{(this.props.data.visibility/1609.344).toFixed(2)} MI</h1>
              <h2>Visibility</h2>
              <br/>
              <h1>{this.props.data.main.pressure}</h1>
              <h2>Pressure</h2>
            </div>
            <div className="right_block">
              <h1>{this.props.data.main.humidity} %</h1>
              <h2>Humidity</h2>
              <br/>
              <h1>{Sunrise.getHours()}</h1>
              <h2>Sunrise</h2>
              <br/>
              <h1>{Sunset.getHours()}</h1>
              <h2>Sunset</h2>
            </div>
          </div>
        </div>
      );
    } else return null;
  }
}

export default OtherWeatherData;
